DROP DATABASE IF EXISTS bd;
CREATE DATABASE bd;
USE bd;

CREATE TABLE profesores (
  NoTrabajador INT NOT NULL,
  Nombres VARCHAR(100) NOT NULL,
  Clave VARCHAR(60) NOT NULL,
  PRIMARY KEY (NoTrabajador)
);

CREATE TABLE jornadas_academicas (
  NoControl VARCHAR(11) UNIQUE NOT NULL,
  ApellidoP VARCHAR(25) NOT NULL,
  ApellidoM VARCHAR(25) NOT NULL,
  Nombres VARCHAR(50) NOT NULL,
  `2019` VARCHAR(255) NULL,
  `2021_A` VARCHAR(255) NULL,
  `2021_B` VARCHAR(255) NULL,
  `2022` VARCHAR(255) NULL,
  `2023` VARCHAR(255) NULL,
  Conteo INT NOT NULL DEFAULT 0,
  Estado ENUM('LIBERADO','NO LIBERADO') NOT NULL,
  Atendidos ENUM('ATENDIDO','NO ATENDIDO') NOT NULL,
  PRIMARY KEY (NoControl)
);

CREATE TABLE tutorias (
  NoControl VARCHAR(11) UNIQUE NOT NULL,
  ApellidoP VARCHAR(50) NOT NULL,
  ApellidoM VARCHAR(50) NOT NULL,
  Nombres VARCHAR(100) NOT NULL,
  `E-J 24` VARCHAR(255) NULL,
  `A-D23` VARCHAR(255) NULL,
  `E-J23` VARCHAR(255) NULL,
  `A-D 22` VARCHAR(255) NULL,
  `E-J 22` VARCHAR(255) NULL,
  `A-D 21` VARCHAR(255) NULL,
  `E-J 21` VARCHAR(255) NULL,
  `A-D 20` VARCHAR(255) NULL,
  `E-J 20` VARCHAR(255) NULL,
  Conteo INT NOT NULL DEFAULT 0,
  Estado ENUM('LIBERADO','NO LIBERADO') NOT NULL,
  PRIMARY KEY (NoControl)
);

CREATE TABLE alumnos (
    ID INT AUTO_INCREMENT PRIMARY KEY,
    Nombres VARCHAR(50) NOT NULL,
    ApellidoP VARCHAR(25) NOT NULL,
    ApellidoM VARCHAR(25) NOT NULL,
    Contraseña VARCHAR(100) NOT NULL,
    NoControl VARCHAR(11) NOT NULL,
    FOREIGN KEY (NoControl) REFERENCES jornadas_academicas(NoControl) ON DELETE CASCADE
);

CREATE TABLE rutas_pdf_jornadas (
  ID INT AUTO_INCREMENT PRIMARY KEY,
  NoControl VARCHAR(11) NOT NULL,
  Nombre_archivo VARCHAR(255) NOT NULL,
  Ruta_archivo VARCHAR(255) NOT NULL,
  Columna_ref VARCHAR(255) NOT NULL,
  FOREIGN KEY (NoControl) REFERENCES jornadas_academicas(NoControl) ON DELETE CASCADE
);

CREATE TABLE rutas_pdf_tutorias (
  ID INT AUTO_INCREMENT PRIMARY KEY,
  NoControl VARCHAR(11) NOT NULL,
  Nombre_archivo VARCHAR(255) NOT NULL,
  Ruta_archivo VARCHAR(255) NOT NULL,
  Columna_ref VARCHAR(255) NOT NULL,
  FOREIGN KEY (NoControl) REFERENCES tutorias(NoControl) ON DELETE CASCADE
);



